def count_coprime_pairs(N):
    M = {}

    def f(n):
        if n in M:
            return M[n]
        c = n * n
        i = n
        while i > 1:
            z = n // i
            j = n // (z + 1)
            c -= f(z) * (i - j)
            i = j
        M[n] = c
        return c
    return (f(N) + 1) / 2

